@HodlDee Bitcoin DCA during a bullrun is usually bad. 

E.g. 2017-18 bullrun spent huge amounts of time distributing between 20k and 6k, then at the end went to 3k. Massive loss of BTC

IMO this time is the same. DCA between 70k and 30k, and in the end back to 15-18k.

